import {StyleSheet, View, Text, Button} from 'react-native'
import * as React from 'react';
import { createNativeStackNavigator } from '@react-navigation/native-stack'

const Stack = createNativeStackNavigator();

export function Premade(navigation) {
  const ref = React.useRef(null);  
  
  return (
        <View style={styles.container}>
            <Button 
              title="Soft"
              color='#2196F3'
              onPress={() => {ref.current && ref.current.navigate('Soft')}}
            />
            <Button 
              title="Moderate"
              color='#2196F3'
              onPress={() => {ref.current && ref.current.navigate('Moderate')}}
            />
            <Button 
              title="Firm"
              color='#2196F3'
              onPress={() => {ref.current && ref.current.navigate('Firm')}}
            />
        </View>
      );
}

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },
});
